import React, { useState, useEffect } from "react";
import "./Booking.css";
import {
  Typography,
  Button,
  Grid,
  Select,
  MenuItem,
} from "@material-ui/core";

import Modal from "react-modal";


Modal.setAppElement(document.getElementById("root"));


const Booking = ({ baseUrl, isLogin }) => {
  const [startingPoint, setStartingPoint] = useState("");
  const [destination, setDestination] = useState("");
  const [startingPointList, setStartingPointList] = useState([]);
  const [destinationList, setDestinationList] = useState([]);
  const [booking, setBooking] = useState("");
  const [busList, setBusList] = useState([])


  const accessToken = sessionStorage.getItem("accessToken");
  const getStartingPoint = async () => {
    const url = baseUrl + "bus/startingPoint";


    try {
      const rawResponse = await fetch(url, {
        headers: {
          Authorization: `Bearer ${accessToken}`,
        }
      });

      if (rawResponse.ok) {
        const response = await rawResponse.json();
        await setStartingPointList(response);
      } else {
        const error = new Error();
        error.message = "Some Error Occurred while fetching source";
        throw error;
      }
    } catch (e) {
      alert(e.message);
    }
  };

  const getDestination = async () => {
    const url = baseUrl + "bus/destination";

    try {
      const rawResponse = await fetch(url, {
        headers: {
          Authorization: `Bearer ${accessToken}`,
        }
      });

      if (rawResponse.ok) {
        const response = await rawResponse.json();
        await setDestinationList(response);
      } else {
        const error = new Error();
        error.message = "Some Error Occurred while fetching destination";
        throw error;
      }
    } catch (e) {
      alert(e.message);
    }
  };

  const getFilteredBusses = async (source, destination) => {
    const url = baseUrl + "bus?source=" + encodeURI(source) + "destination=" + encodeURI(destination);

    try {
      const rawResponse = await fetch(url);

      if (rawResponse.ok) {
        const response = await rawResponse.json();
        setDoctorList(response);
      } else {
        const error = new Error();
        error.message = "Some Error Occurred";
        throw error;
      }
    } catch (e) {
      alert(e.message);
    }
  };



  const changeStartingPointHandler = (source) => {
    setStartingPoint(source.target.value);

  };

  const changeDestinationHandler = (destination) => {
    setDestination(destination.target.value);
  };

  // const closeModalHandler = () => {
  //   setIsModalOpen(false);
  // };
  useEffect(() => {
    if (isLogin === true) {
      getDestination();
      getStartingPoint();
    }
    if (startingPoint != null && destination != null) {
      getFilteredBusses(startingPoint, destination)
    }
  }, [isLogin, startingPoint, destination]);

  return (
    <div>
      <form>
        <Grid item xs={12} sm container alignItems="center" direction="column">
          <Typography component="div" id="selectHeading">
            Select Starting Point:
          </Typography>
          <Select
            variant="filled"
            labelId="speciality"
            id="speciality"
            value={startingPoint}
            style={{ minWidth: "200px" }}
            onChange={changeStartingPointHandler}
          >
            <MenuItem key={"spec none"} value={""}>
              NONE
            </MenuItem>
            {startingPointList.map((item) => (
              <MenuItem key={"spec" + item} value={item}>
                {item}
              </MenuItem>
            ))}
          </Select>

          <Typography component="div" id="selectHeading">
            Select Destination:
          </Typography>
          <Select
            variant="filled"
            labelId="speciality"
            id="speciality"
            value={destination}
            style={{ minWidth: "200px" }}
            onChange={changeDestinationHandler}
          >
            <MenuItem key={"spec none"} value={""}>
              NONE
            </MenuItem>

            {destinationList.map((item) => (
              <MenuItem key={"spec" + item} value={item}>
                {item}
              </MenuItem>
            ))}

          </Select>


          {busList.map((bus) => {
            return (
              <Paper
                key={doctor.id}
                variant="elevation"
                className="doctorListContainer"
                elevation={3}
              >
                <Typography variant="h6" component="h2" gutterBottom>
                  Doctor Name : {doctor.firstName} {doctor.lastName}
                </Typography>
                <br />
                <Typography component="h4" variant="body1">
                  Speciality : {doctor.speciality}
                </Typography>
                <Typography component="h4" variant="body1">
                  Rating :
                  <Rating name="read-only" value={doctor.rating} readOnly />
                </Typography>
                <Button
                  style={{ width: "40%", margin: "10px" }}
                  variant="contained"
                  color="primary"
                  onClick={() => {
                    setDoctor(doctor);
                    setModalType("bookings");
                    setIsModalOpen(true);
                  }}
                >
                  Book Appointment
                </Button>
                <Button
                  style={{
                    width: "40%",
                    margin: "10px",
                    backgroundColor: "green",
                  }}
                  variant="contained"
                  color="secondary"
                  onClick={() => {
                    setDoctor(doctor);
                    setModalType("details");
                    setIsModalOpen(true);
                  }}
                >
                  View Details
                </Button>
              </Paper>
            );
          })}
          <Modal
            ariaHideApp={false}
            isOpen={isModalOpen}
            onRequestClose={closeModalHandler}
            style={modalType === "details" ? detailsModal : bookingsModal}
          >
            {modalType === "details" && <DoctorDetails doctor={doctor} />}
            {modalType === "bookings" && (
              <BookAppointment
                baseUrl={baseUrl}
                doctor={doctor}
                getUserAppointments={getUserAppointments}
                userAppointments={userAppointments}
                closeModalHandler={closeModalHandler}
              />
            )}
          </Modal>



        </Grid>
      </form>
    </div >
  );
};

export default Booking;
